import React from 'react';



const Home = () => {
return(
   <>


   <h1>About Me</h1>

   <h2>Software Engineer</h2>

   <p>I am a driven team player who uses my systematic and analytical skills to help the company accomplish its goals. Looking for a fast-paced environment with room to learn and grow with the company.</p>



   </>
)
}





export default Home;
